import './App.css';
import Navbar from './components/Navbar/Navbar.js';
import { Typography } from '@material-ui/core';
import {BrowserRouter,Route} from 'react-router-dom';
import Customer from './components/Customer/Customer.js'
function App() {
  return (
    <BrowserRouter>
    <Navbar/>
    <Typography variant='h3' color="primary" className='quote'>#getVaccinated</Typography>
    <Typography variant='h4' color="primary" className='instruction'>Please register accordingly if you are a customer or a seller</Typography>

    <div>
      <Route path='/customer' component={Customer}/> 
    </div>

    </BrowserRouter>
  );
}

export default App;
